function RequestSubmission() {
  return (
    <div className="RequestSubmission">
      <HeaderContainer />
      <h1 class="greeting">Hi, Jane!</h1>
      <RequestSubmissionContainer />
    </div>
  );
}

export default RequestSubmission;
